Подбор составного кода в котором неизвестен порядок кодов. В случае, если известно расположение кода в составном коде, можно указать его позицию на макете
(клик на fix, потом клик на место в макете). Пример задания : задание с атомом одного энкора, где было известны все составляющие, порядок был неизвестен. Ответ был kmonpf